import React from "react";
import strings from "../../../localization";
import ErrorViewer from "../../ErrorViewer";
import getErrorClass from "../../../functions/Validation";
import Select from "../../controls/Select";
import { getGenderList } from "../../../constants/Gender";
import { getRelationshipTypesList } from "../../../constants/RelationshipType";
import CheckGroup from "../../controls/CheckGroup";
import DateSelect from "../../controls/DateSelect";
import "rc-slider/assets/index.css";
import Range from "rc-slider";
import { Link } from "react-router-dom";

const RegistrationSecondStepForm = ({ onChange, errors, data, onSubmit }) => (
  <form id="register-form-2" className="lrp-form-container">
    <div className="lrp-form-title">{strings.registrationForm2.title}</div>
    <div className="form-row mb-5">
      <div className="column"></div>
    </div>
    <div className="form-row mb-5">
      <div className="column">
        <div className="label center">
          <label>{strings.registrationForm2.add}</label>
        </div>
      </div>
    </div>
    <div className="form-row mb-5">
      <div className="column">
        <div className="label ">
          <label>{strings.registrationForm2.description}</label>
        </div>
      </div>
    </div>

    <div className="form-row">
      <div className="column controls">
        <a
          onClick={(event) => onSubmit(event)}
          className="btn lrp-btn btn-red uppercase"
        >
          {strings.registrationForm2.upload}
        </a>
      </div>
    </div>

    <div className="form-row">
      <div className="column not-a-member">
        <Link className="space" to={"/registration"}>
          {strings.loginForm.signUpNow}
        </Link>
      </div>
    </div>
  </form>
);

export default RegistrationSecondStepForm;
